// src/MainPage.js
import React, { useEffect, useState } from 'react';
import Chart from 'react-apexcharts';
import io from 'socket.io-client';

const ENDPOINT = 'http://localhost:5000';

const MainPage = ({ toggleSidebar }) => {
  const [chartData, setChartData] = useState({
    cpuUsageChart: {
      series: [],
      options: {
        chart: { type: 'radialBar', toolbar: { show: false } },
        plotOptions: {
          radialBar: {
            dataLabels: {
              name: { show: true },
              value: { show: true },
            },
          },
        },
        theme: { palette: 'palette5' },
      },
    },
    memoryUsageChart: {
      series: [],
      options: {
        chart: { type: 'radialBar', toolbar: { show: false } },
        plotOptions: {
          radialBar: {
            dataLabels: {
              name: { show: true },
              value: { show: true },
            },
          },
        },
        theme: { palette: 'palette5' },
      },
    },
    responseTimeChart: {
      series: [],
      options: {
        chart: { type: 'line', toolbar: { show: false } },
        xaxis: { categories: [] },
        theme: { palette: 'palette5' },
      },
    },
    activeConnectionsChart: {
      series: [],
      options: { chart: { type: 'bar', toolbar: { show: false } }, xaxis: { categories: [] } },
    },
    diskUsageChart: {
      series: [],
      options: {
        chart: { type: 'radialBar', toolbar: { show: false } },
        plotOptions: {
          radialBar: {
            dataLabels: {
              name: { show: true },
              value: { show: true },
            },
          },
        },
        theme: { palette: 'palette5' },
      },
    },
    errorRateChart: {
      series: [],
      options: {
        chart: { type: 'line', toolbar: { show: false } },
        xaxis: { categories: [] },
        theme: { palette: 'palette5' },
      },
    },
  });

  useEffect(() => {
    const socket = io(ENDPOINT);

    socket.on('performanceData', (metrics) => {
      console.log('Received metrics:', metrics);

      const currentTime = new Date().toISOString();
      setChartData({
        cpuUsageChart: {
          series: [{ name: 'CPU Usage', data: [parseFloat(metrics.cpu_usage)] }],
          options: { ...chartData.cpuUsageChart.options },
        },
        memoryUsageChart: {
          series: [{ name: 'Memory Usage', data: [parseFloat(metrics.memory_usage)] }],
          options: { ...chartData.memoryUsageChart.options },
        },
        responseTimeChart: {
          series: [{ name: 'Response Time', data: [parseFloat(metrics.response_time)] }],
          options: { xaxis: { categories: [currentTime] } },
        },
        activeConnectionsChart: {
          series: [{ name: 'Active Connections', data: [metrics.active_connections] }],
          options: { xaxis: { categories: [currentTime] } },
        },
        diskUsageChart: {
          series: [{ name: 'Disk Usage', data: [parseFloat(metrics.disk_usage)] }],
          options: { ...chartData.diskUsageChart.options },
        },
        errorRateChart: {
          series: [{ name: 'Error Rate', data: [parseFloat(metrics.error_rate)] }],
          options: { xaxis: { categories: [currentTime] } },
        },
      });
    });

    return () => socket.disconnect();
  }, []);

  return (
    <div className="main-page bg-gradient-to-r from-blue-800 via-purple-700 to-pink-600 min-h-screen p-8">
      <button
        onClick={toggleSidebar}
        className="bg-yellow-500 text-white p-3 rounded-md hover:bg-yellow-600 transition duration-300 transform hover:scale-105 mb-6"
      >
        Toggle Sidebar
      </button>

      <div className="py-8 px-4">
        <h2 className="text-4xl font-extrabold text-white mb-6">Database Performance Monitoring Dashboard</h2>

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {/* Display charts */}
          {Object.entries(chartData).map(([key, chart]) => (
            <div key={key} className="chart-container">
              <h3 className="text-2xl font-semibold text-white mb-4">{key.replace('Chart', '').replace(/([A-Z])/g, ' $1').trim()}</h3>
              <Chart
                options={chart.options}
                series={chart.series}
                type={chart.options.chart.type}
                height={350}
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default MainPage;
